    Migration Abundance and Chronology Survey at Quivira National Wildlife refuge.  It
    is necessary to survey waterfowl populations on the refuge to determine if current
    management practices are supporting the refuge objectives.  This document includes
    the procedure of the Waterfowl Migration Abundance and Chronology Survey as well
    as a survey route map.  This ISI was used in the development of the refuge's 1989
    IMP and the current survey procedures may vary slightly from those specified in
    this document.  This survey is a bi-weekly waterfowl survey.",nt"license_title":
